script: |
  super -f text -I q681.spq | sort > q681.out

inputs:
  - name: q681.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE 59 / col2 NOT BETWEEN - 69 + col2 * col2 AND - ( + col2 );
  - name: tab1

outputs:
  - name: q681.out
    data: |
      51	14	96
      85	5	59
      91	47	68
